import React, { useState, useEffect } from "react";

const Homepage = () => {
  const [userData, setUserData] = useState(null);

  useEffect(() => {
    fetch("http://localhost:5050/userData", {
      method: "POST",
      crossDomain: true,
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
        "Access-Control-Allow-Origin": "*",
      },
      body: JSON.stringify({
        token: window.localStorage.getItem("token"),
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userdata");
        setUserData(data.data);
      });
  }, []);

  const logout = () => {
    window.localStorage.clear();
    window.location.href = "./";
  };

  return (
    <div>
      <div className="bg-zinc-400 h-screen flex justify-center items-center">
        <div className="bg-white rounded-lg shadow-black/30 h-96 pl-10 space-y-3 w-[350px] flex flex-col justify-center">
          {userData && (
            <div className="bg-white-400 ">
              <h1>Name: {userData.fname}</h1>
              <h1>Email: {userData.Email}</h1>
              <br />
              <button
                onClick={logout}
                className="flex justify-center items-center bg-slate-900 w-20 h-7 text-white rounded-full"
              >
                Log Out
              </button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Homepage;
